import React from 'react';

import { WorkMonth } from '../../models';

import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';

interface Props {
	confirmed: () => WorkMonth;
	canceled: () => void;
}

export const NewMonthForm = (props: Props) => {
	const {confirmed, canceled, title} = props;

	return (
		<>
			<DialogTitle>Новый месяц</DialogTitle>
	        <DialogContent>
	          <TextField
	            autoFocus
	            margin="dense"
	            label="План"
	            type="text"
	            fullWidth
	          />

	          <TextField
	            autoFocus
	            margin="dense"
	            label="Количество смен"
	            type="text"
	            fullWidth
	          />
	        </DialogContent>
	        <DialogActions>
	          <Button onClick={canceled} color="primary">
	            Отмена
	          </Button>
	          <Button onClick={confirmed} color="primary">
	            Создать
	          </Button>
	        </DialogActions>
		</>
	)
}
